import React from 'react';
import CatItem from './CatItem.jsx';
import Sweet2 from '../images/sweet2.jpg';

function Categories(){
    return(
        <div className = "categoriesContainer">
            <CatItem  catName = "Sweets" catImg = {Sweet2} />
            <CatItem  catName = "Chaats" catImg = "https://bit.ly/3h4NOw9" />
            <CatItem  catName = "Parathas" catImg = "https://bit.ly/3h4NOw9" />
        </div>
    );
}

export default Categories;
